import React from 'react';
import'./style.css';

/**
* @author
* @function Home
**/

const Home = (props) => {
  return(
    <div className="post">
      <section className="left-container">
        akash
      </section>
      <section className="right-container">
        <section className="container">
         akash
        </section>
        <section className="container-1">
          wagh
        </section>
      </section>
    
    </div> 
   )

 }

export default Home;
